import React, { useEffect } from 'react';
import logo from '../../logo.svg'
import './addTiffinCenter.css';
import { saveData } from '../../Services/dbService';



const AddTiffinCenter = () => {

  useEffect(()=>{
    saveData('DummyData/TiffinCenterData',{name:'Anil Sharmaa',centerName:'Shree Shayam Tiffin Center'})
    // (ref(database, 'DummyData/TiffinCenterData'), {name:'Anil Sharmaa',centerName:'Shree Shayam Tiffin Center'});
  },[])
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="logo" />
        <p>
          {/* Edit <code>src/App.js</code> and save to reload. */}
          Hello , Your Tiffin center is here
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        
        </a>
      </header>
    </div>
  );
};

export default AddTiffinCenter;
